import React from 'react';
import { Button, Container, Nav, Navbar } from "react-bootstrap";
import { NavLink } from "react-router-dom";  // Это должно быть из react-router-dom, а не из react-bootstrap
import { observer } from "mobx-react-lite";
import {useNavigate} from "react-router-dom";
import {LOGIN_ROTE, MENU_ROUTE} from "../utils/const";

const MyNavBar = observer(() => {
    
    return (
        <Navbar bg="light" expand="lg">
            <Container>
                <NavLink to={MENU_ROUTE}>Menu</NavLink>
                <Nav>
                    <Button
                        variant="outline-light"
                        onClick={() => history(LOGIN_ROTE)}
                    >

                    </Button>
                </Nav>
            </Container>
        </Navbar>
    );
});

export default MyNavBar;
